const SkillForm = (props) =>(
<div className="skill-container">
<h1 className="skill_heading">Add Skills</h1>
  <form className="form" onSubmit={props.handleSubmit} >

   <input required type="text" ref={(input)=>props.getTitle = input}
   placeholder="Add Skills"/> <br /><br />
   <textarea required rows="4" ref={(input)=>props.getMessage = input}cols="28"
   placeholder="Skills detail" /><br /><br />
   <button>Add</button>
  </form>
</div>
);

export default SkillForm;
